import Avatar from "../Avatar/Avatar";
import './Email.css'
// import moment from 'moment';

const Email = ({ email, fav, read, active }) => {

    return (
        <li>
            <Avatar />
            <section className="email__list">
                <header>
                    <p>
                    From:
                        <strong>
                        hello
                        </strong>
                    </p>
                    <p>
                        Subject: <strong>Jago mohan pyare</strong>
                    </p>
                </header>
                <p  className="description">Yo Yo Yo Yo</p>
                <footer>
                <p>
                    {/* {moment(date).calendar()} {moment(date).format("LT")}{" "} */}
                    {/* {fav.includes(id) && <span id={id}>Favorite</span>} */}
                </p>
                </footer>
            </section>
        </li>
    )
}

export default Email;
